class Bigpokemon():
    def __init__(self):
        self.pokemon_data = self.get_datas()

    def get_datas(self):
        data = dddd  # dddd 第31行的小精靈資料
        for i in data.values():
            count = 1
            for j in i:
                j['id'] = '#{:0>3d}'.format(count)  # 原本是1-893 照generation分類後每個generation都從1開始重新編號
                count += 1
        return data

    def get_show_data(self, generation, num):
        for ele in self.pokemon_data[generation]:
            if ele['id'] == '#{:0>3d}'.format(num):
                image = ele['image2']
                id = ele['id']
                name = ele['name']
                attrs = list(zip(['Attrs:', '', ''], ele['attrs']))
                Species = ele['Species']
                Height = ele['Height']
                Weight = ele['Weight']
                Abilities = list(zip(['Abilities:', '', ''], ele['Abilities']))
                base_stats = list(ele['base stats'].items())
                keys = ['image', 'id', 'name', 'attrs', 'Species', 'Height', 'Weight', 'Abilities',
                        'base_stats', 'start', 'end']
                ori_data = [image, id, name, attrs, Species, Height, Weight, Abilities, base_stats]
                return dict(zip(keys, ori_data))

